  `opt_type` varchar(50) NOT NULL COMMENT '操作类型，C、新建，U、修改，D、删除',
  `opt_user_id` int(10) unsigned NOT NULL COMMENT '操作人ID',
  `opt_user_name` varchar(50) NOT NULL COMMENT '操作人名称',
