DROP TABLE IF EXISTS `member`;
CREATE TABLE `member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '用户名',
  `password` varchar(50) NOT NULL COMMENT '密码',
  `grade` int(11) NOT NULL DEFAULT '1' COMMENT '会员等级',
  `grade_value` int(11) NOT NULL DEFAULT '0' COMMENT '会员经验值',
  `integral` int(11) NOT NULL DEFAULT '0' COMMENT '会员积分',
  `register_time` datetime NOT NULL COMMENT '注册时间',
  `last_login_time` datetime NOT NULL COMMENT '最后登录时间',
  `last_login_ip` varchar(50) NOT NULL COMMENT '最后登录IP',
  `login_number` int(11) NOT NULL COMMENT '登陆次数',
  `last_address_id` int(11) DEFAULT NULL COMMENT '上次使用的地址',
  `last_payment_code` int(11) DEFAULT NULL COMMENT '上次使用的支付方式',
  `gender` tinyint(1) DEFAULT '0' COMMENT '性别0、保密；1、男；2、女',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `qq` varchar(50) DEFAULT NULL COMMENT 'qq',
  `mobile` varchar(50) DEFAULT NULL COMMENT 'mobile',
  `phone` varchar(50) DEFAULT NULL COMMENT '电话',
  `pwd_err_count` int(11) NOT NULL DEFAULT '0' COMMENT '密码输入错误次数',
  `source` tinyint(4) NOT NULL COMMENT '会员来源1、pc；2、H5；3、Android；4、IOS ;5、微信商城',
  `balance` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '账户余额',
  `balance_pwd` varchar(60) NOT NULL COMMENT '账户支付密码',
  `is_email_verify` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否验证邮箱0、未验证；1、验证',
  `is_sms_verify` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否验证手机0、未验证；1、验证',
  `sms_verify_code` varchar(20) NOT NULL COMMENT '短信验证码',
  `email_verify_code` varchar(20) NOT NULL COMMENT '邮件验证码',
  `can_receive_sms` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接受短信0、不接受；1、接受',
  `can_receive_email` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接收邮件',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1、正常使用；2、停用',
  `token` varchar(200) DEFAULT NULL,
  `update_time` datetime NOT NULL,
  `session_id` varchar(200) DEFAULT NULL,
  `sms_code` varchar(255) DEFAULT NULL,
  `integral_shop` int(11) DEFAULT '0' COMMENT '商城会员积分',
  `integral_person_coach` int(11) DEFAULT '0' COMMENT '好私教积分',
  `integral_coach` int(11) DEFAULT '0' COMMENT '教练积分',
  `salecode` varchar(20) DEFAULT '' COMMENT '推广码',
  `userid_yj` varchar(50) DEFAULT '' COMMENT '易健userid',
  `unionid_yj` varchar(50) DEFAULT '' COMMENT '易健unionid',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='会员';

