-- Table structure for pc_seller_recommend
-- ----------------------------
DROP TABLE IF EXISTS `pc_seller_recommend`;
CREATE TABLE `pc_seller_recommend` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seller_id` int(10) unsigned NOT NULL COMMENT '商家ID',
  `title` varchar(100) NOT NULL COMMENT '推荐标题',
  `order_no` int(2) NOT NULL COMMENT '排序号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态1使用2预使用3不使用',
  `remark` varchar(255) DEFAULT NULL COMMENT '描述',
  `create_user_id` int(10) unsigned NOT NULL,
  `create_user_name` varchar(50) NOT NULL,
  `create_time` datetime NOT NULL,
  `update_user_id` int(10) unsigned NOT NULL,
  `update_user_name` varchar(50) NOT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='PC端商家推荐类型表';

-- ----------------------------
-- Records of pc_seller_recommend
-- ----------------------------

-- ----------------------------
-- Table structure for pc_seller_recommend_data
-- ----------------------------
DROP TABLE IF EXISTS `pc_seller_recommend_data`;
CREATE TABLE `pc_seller_recommend_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seller_id` int(10) unsigned NOT NULL COMMENT '商家ID',
  `recommend_id` int(10) unsigned NOT NULL COMMENT '推荐类型ID',
  `data_type` tinyint(1) unsigned NOT NULL COMMENT '数据类型：1商品2图片链接',
  `ref_id` int(10) unsigned DEFAULT NULL COMMENT '数据ID（data_type为1表示商品ID）',
  `title` varchar(200) DEFAULT NULL COMMENT '图片链接标题',
  `image` varchar(200) DEFAULT NULL COMMENT '图片地址',
  `link_url` varchar(200) DEFAULT NULL COMMENT '图片链接地址',
  `order_no` int(2) NOT NULL COMMENT '排序号',
  `remark` varchar(255) DEFAULT NULL COMMENT '数据说明',
  `create_user_id` int(10) unsigned NOT NULL,
  `create_user_name` varchar(50) NOT NULL,
  `create_time` datetime NOT NULL,
  `update_user_id` int(10) unsigned NOT NULL,
  `update_user_name` varchar(50) NOT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='PC端商家推荐数据表';

-- ----------------------------
-- Records of pc_seller_recommend_data
-- ----------------------------

-- ----------------------------
-- Table structure for product
-- ----------------------------
DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_cate_id` int(11) NOT NULL COMMENT '分类ID',
  `product_cate_path` varchar(50) NOT NULL COMMENT '商品所属分类路径（只包含父路径）',
  `name1` varchar(200) NOT NULL DEFAULT '' COMMENT '商品名称建议50个字符',
  `name2` varchar(200) NOT NULL DEFAULT '' COMMENT '商品促销信息（建议100个字符）',
  `keyword` varchar(200) NOT NULL COMMENT '商品关键字，用于检索商品，用逗号分隔',
  `product_brand_id` int(11) NOT NULL COMMENT '品牌ID',
  `is_self` tinyint(4) NOT NULL COMMENT '1、自营；2、商家',
  `cost_price` decimal(10,2) NOT NULL COMMENT '成本价',
  `protected_price` decimal(10,2) NOT NULL COMMENT '保护价，最低价格不能低于',
  `market_price` decimal(10,2) NOT NULL COMMENT '市场价',
  `mall_pc_price` decimal(10,2) NOT NULL COMMENT '商城价',
  `mal_mobile_price` decimal(10,2) NOT NULL COMMENT '商城价Mobile',
  `virtual_sales` int(11) NOT NULL COMMENT '虚拟销量',
  `actual_sales` int(11) NOT NULL COMMENT '实际销量',
  `product_stock` int(11) NOT NULL COMMENT '商品库存',
  `is_norm` tinyint(4) NOT NULL COMMENT '1、没有启用规格；2、启用规格',
  `norm_ids` varchar(255) NOT NULL COMMENT '规格ID集合',
  `norm_name` varchar(255) NOT NULL DEFAULT '' COMMENT '规格属性值集合 空',
  `state` tinyint(3) NOT NULL DEFAULT '0' COMMENT '1、刚创建；2、提交审核；3、审核通过；4、申请驳回；5、商品删除；6、上架；7、下架',
  `is_top` tinyint(4) NOT NULL COMMENT '1、不推荐；2、推荐',
  `up_time` datetime NOT NULL COMMENT '商品上架时间',
  `description` text NOT NULL COMMENT '商品描述信息',
  `packing` text NOT NULL COMMENT '包装清单',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `create_id` int(11) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `seller_cate_id` int(11) NOT NULL COMMENT '商家分类ID',
  `seller_is_top` tinyint(4) NOT NULL COMMENT '商品推荐，1、不推荐；2、推荐',
  `seller_state` tinyint(4) NOT NULL COMMENT '店铺状态：1、店铺正常；2、店铺关闭 默认1',
  `comments_number` int(11) NOT NULL DEFAULT '0' COMMENT '评价总数',
  `product_cate_state` tinyint(4) NOT NULL COMMENT '平台商品分类状态：1、分类正常；2、分类关闭 默认1',
  `is_invented_product` tinyint(4) NOT NULL COMMENT '是否是虚拟商品：1、实物商品；2、虚拟商品',
  `transport_type` tinyint(1) DEFAULT NULL COMMENT '运费计算类型：1、按件，2、按重量，3、按体积',
  `transport_id` int(11) DEFAULT NULL COMMENT '运费模板id',
  `master_img` varchar(200) NOT NULL DEFAULT '' COMMENT '主图',
  `product_code` varchar(50) NOT NULL DEFAULT '' COMMENT '商品编码',
  `sale_scale1` decimal(10,2) DEFAULT NULL COMMENT '一级分佣比例',
  `sale_scale2` decimal(10,2) DEFAULT NULL COMMENT '二级分佣比例',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8 COMMENT='商品表';

-- ----------------------------
-- Records of product
-- ----------------------------

-- ----------------------------
-- Table structure for product_ask
-- ----------------------------
DROP TABLE IF EXISTS `product_ask`;
CREATE TABLE `product_ask` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `product_id` int(11) NOT NULL COMMENT '商品ID',
  `user_id` int(11) NOT NULL COMMENT '咨询人ID',
  `user_name` varchar(255) NOT NULL COMMENT '咨询人账号',
  `ask_content` varchar(255) NOT NULL COMMENT '咨询内容',
  `reply_id` int(11) DEFAULT NULL COMMENT '回复人ID',
  `reply_name` varchar(50) DEFAULT NULL COMMENT '回复人账号',
  `reply_content` varchar(255) DEFAULT NULL COMMENT '回复内容',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `reply_time` datetime DEFAULT NULL COMMENT '回复时间',
  `state` tinyint(4) NOT NULL COMMENT '1、咨询；2、已经回答；3、前台显示；4、删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='商品咨询管理';

-- ----------------------------
-- Records of product_ask
-- ----------------------------

-- ----------------------------
-- Table structure for product_attr
-- ----------------------------
DROP TABLE IF EXISTS `product_attr`;
CREATE TABLE `product_attr` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL COMMENT '商品ID',
  `product_type_attr_id` int(11) NOT NULL COMMENT '属性ID，可以根据属性ID来进行检索',
  `name` varchar(50) NOT NULL COMMENT '属性名称',
  `value` varchar(200) NOT NULL COMMENT '属性值',
  `state` tinyint(4) NOT NULL COMMENT '1、检索属性；2、自定义属性；3、商品自定义属性（product_tyep_attr_id=0）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1066 DEFAULT CHARSET=utf8 COMMENT='商品对应属性表(保存商品时插入)';

-- ----------------------------
-- Records of product_attr
-- ----------------------------

-- ----------------------------
-- Table structure for product_brand
-- ----------------------------
DROP TABLE IF EXISTS `product_brand`;
CREATE TABLE `product_brand` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '品牌名称',
  `name_first` varchar(1) NOT NULL COMMENT '品牌首字母',
  `image` varchar(200) NOT NULL DEFAULT '' COMMENT '品牌图片',
  `look_method` tinyint(4) NOT NULL COMMENT '展示方式1、图片；2、文字',
  `top` tinyint(4) NOT NULL COMMENT '推荐1、推荐；2、不推荐',
  `sort` int(4) NOT NULL COMMENT '排序',
  `create_id` int(11) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_id` int(11) NOT NULL COMMENT '更新人',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `state` tinyint(4) NOT NULL COMMENT '状态 0、默认；1、提交审核；2、显示中；3、审核失败；4、删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='商品品牌';

-- ----------------------------
-- Records of product_brand
-- ----------------------------

-- ----------------------------
-- Table structure for product_cate
-- ----------------------------
DROP TABLE IF EXISTS `product_cate`;
CREATE TABLE `product_cate` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_type_id` int(11) NOT NULL DEFAULT '0' COMMENT '类型ID',
  `pid` int(11) NOT NULL COMMENT '父类ID',
  `name` varchar(20) NOT NULL COMMENT '分类名称',
  `path` varchar(200) NOT NULL DEFAULT '' COMMENT '上级分类路径',
  `scaling` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '分佣比例(商家给平台的分佣比例，填写0到1的数字)',
  `create_id` int(11) NOT NULL COMMENT '创建人',
  `update_id` int(11) NOT NULL COMMENT '更新人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `sort` int(11) NOT NULL COMMENT '排序',
  `status` tinyint(4) NOT NULL COMMENT '0、默认；1、提交审核；2、审核通过；3、审核失败；4、停用',
  `image` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=373 DEFAULT CHARSET=utf8 COMMENT='商品分类';

-- ----------------------------
-- Records of product_cate
-- ----------------------------

-- ----------------------------
-- Table structure for product_comments
-- ----------------------------
DROP TABLE IF EXISTS `product_comments`;
CREATE TABLE `product_comments` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '评价人ID',
  `user_name` varchar(50) NOT NULL COMMENT '评价人账号',
  `grade` tinyint(4) NOT NULL COMMENT '评分(1到5)',
  `content` varchar(255) NOT NULL COMMENT '评价内容',
  `seller_attitude` varchar(255) DEFAULT NULL COMMENT '评价商家服务',
  `create_time` datetime NOT NULL COMMENT '评价时间',
  `product_id` int(11) NOT NULL COMMENT '评价商品',
  `product_goods_id` int(11) NOT NULL COMMENT '货品ID',
  `seller_id` int(11) NOT NULL COMMENT '所属商家',
  `order_sn` varchar(50) NOT NULL COMMENT '订单编号',
  `orders_product_id` int(11) NOT NULL COMMENT '网单ID',
  `reply_id` int(11) DEFAULT NULL COMMENT '回复人ID',
  `reply_name` varchar(255) DEFAULT NULL COMMENT '回复人名称',
  `reply_content` varchar(255) DEFAULT NULL COMMENT '回复内容',
  `state` tinyint(4) DEFAULT NULL COMMENT '1、评价；2、审核通过，前台显示；3、删除',
  `admin_id` int(11) DEFAULT NULL COMMENT '审核上架人',
  `description` tinyint(4) NOT NULL COMMENT '描述相符(1到5星)',
  `service_attitude` tinyint(4) NOT NULL COMMENT '服务态度(1到5星)',
  `product_speed` tinyint(4) NOT NULL COMMENT '发货速度(1到5星)',
  `logistics_speed` tinyint(4) DEFAULT NULL COMMENT '物流态度（1到5星）',
  `express_attitude` tinyint(4) DEFAULT NULL COMMENT '快递员态度(1到5星)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='商品评论管理';

-- ----------------------------
-- Records of product_comments
-- ----------------------------

-- ----------------------------
-- Table structure for product_goods
-- ----------------------------
DROP TABLE IF EXISTS `product_goods`;
CREATE TABLE `product_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL COMMENT '商品ID',
  `norm_attr_id` varchar(255) NOT NULL COMMENT '规格属性值ID，用逗号分隔',
  `norm_name` varchar(255) NOT NULL COMMENT '规格值，用逗号分隔',
  `mall_pc_price` decimal(10,2) NOT NULL COMMENT 'PC价格',
  `mall_mobile_price` decimal(10,2) NOT NULL COMMENT 'Mobile价格',
  `product_stock` int(11) NOT NULL COMMENT '库存',
  `product_stock_warning` int(11) NOT NULL COMMENT '库存预警值',
  `actual_sales` int(11) NOT NULL COMMENT '所有规格销量相加等于商品总销量',
  `sku` varchar(50) NOT NULL,
  `images` varchar(255) DEFAULT NULL COMMENT '规格图片（规格图片，用逗号隔开，和规格值对应，如果没有图片，那为空）',
  `state` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用 1-启用 0-不启用',
  `weight` decimal(10,3) DEFAULT '0.000' COMMENT '重量kg',
  `length` int(11) DEFAULT '0' COMMENT '长度cm',
  `width` int(11) DEFAULT '0' COMMENT '宽度cm',
  `height` int(11) DEFAULT '0' COMMENT '高度cm',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=174 DEFAULT CHARSET=utf8 COMMENT='货品表';

-- ----------------------------
-- Records of product_goods
-- ----------------------------

-- ----------------------------
-- Table structure for product_norm
-- ----------------------------
DROP TABLE IF EXISTS `product_norm`;
CREATE TABLE `product_norm` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '规格名称',
  `sort` int(11) NOT NULL COMMENT '排序',
  `type` tinyint(4) NOT NULL COMMENT '规格类型1、文字；2、图片',
  `create_id` int(11) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_id` int(11) NOT NULL COMMENT '更新人',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `state` tinyint(4) NOT NULL COMMENT '状态 0：删除 1:正常',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='商品规格表';

-- ----------------------------
-- Records of product_norm
-- ----------------------------

-- ----------------------------
-- Table structure for product_norm_attr
-- ----------------------------
DROP TABLE IF EXISTS `product_norm_attr`;
CREATE TABLE `product_norm_attr` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '属性名称',
  `product_norm_id` int(11) NOT NULL COMMENT '规格ID',
  `sort` int(11) NOT NULL COMMENT '排序',
  `create_id` int(11) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `image` varchar(200) NOT NULL COMMENT '默认图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=59 DEFAULT CHARSET=utf8 COMMENT='规格属性表';

-- ----------------------------
-- Records of product_norm_attr
-- ----------------------------

-- ----------------------------
-- Table structure for product_norm_attr_opt
-- ----------------------------
DROP TABLE IF EXISTS `product_norm_attr_opt`;
CREATE TABLE `product_norm_attr_opt` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_norm_id` int(11) DEFAULT NULL COMMENT '规格ID',
  `product_norm_name` varchar(32) DEFAULT NULL COMMENT '规格名称',
  `product_id` int(11) DEFAULT NULL COMMENT '商品ID',
  `seller_id` int(11) DEFAULT NULL COMMENT '商家ID',
  `type_attr` tinyint(4) DEFAULT NULL COMMENT '1、商城属性 2、自定义属性',
  `type` tinyint(4) DEFAULT NULL COMMENT '1、文字；2、图片',
  `name` varchar(50) DEFAULT NULL COMMENT '属性名称',
  `image` varchar(200) DEFAULT NULL COMMENT '图片',
  `create_id` int(11) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `attr_id` int(11) DEFAULT NULL COMMENT '属性id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=106 DEFAULT CHARSET=utf8 COMMENT='商品选定的颜色规格';

-- ----------------------------
-- Records of product_norm_attr_opt
-- ----------------------------

-- ----------------------------
-- Table structure for product_picture
-- ----------------------------
DROP TABLE IF EXISTS `product_picture`;
CREATE TABLE `product_picture` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL COMMENT '商品ID',
  `image_path` varchar(255) NOT NULL COMMENT '图片路径',
  `sort` int(11) NOT NULL COMMENT '排序',
  `create_id` int(11) NOT NULL COMMENT '上传人',
  `create_time` datetime NOT NULL COMMENT '上传时间',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `state` tinyint(4) NOT NULL COMMENT '1、启用；2、不启用',
  `product_lead` tinyint(4) NOT NULL COMMENT '商品主图1、主图；2、非主图，主图只能有一张',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=258 DEFAULT CHARSET=utf8 COMMENT='商品对应图片表';

-- ----------------------------
-- Records of product_picture
-- ----------------------------

-- ----------------------------
-- Table structure for product_type
-- ----------------------------
DROP TABLE IF EXISTS `product_type`;
CREATE TABLE `product_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '名称',
  `sort` int(11) NOT NULL COMMENT '排序',
  `product_norm_ids` varchar(255) NOT NULL COMMENT '关联规格ID集合',
  `product_brand_ids` text NOT NULL COMMENT '关联品牌ID集合',
  `create_id` int(11) NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='商品类型表';

-- ----------------------------
-- Records of product_type
-- ----------------------------

-- ----------------------------
-- Table structure for product_type_attr
-- ----------------------------
DROP TABLE IF EXISTS `product_type_attr`;
CREATE TABLE `product_type_attr` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '属性名称',
  `value` text NOT NULL COMMENT '属性值，用逗号隔开',
  `product_type_id` int(11) NOT NULL COMMENT '属性分类id',
  `type` tinyint(4) NOT NULL COMMENT '1、检索属性；2、自定义属性',
  `create_id` int(11) NOT NULL COMMENT '创建人ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序0到255，越大越靠前展示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8 COMMENT='商品类型属性表';

-- ----------------------------
-- Records of product_type_attr
-- ----------------------------

-- ----------------------------
-- Table structure for regions
-- ----------------------------
DROP TABLE IF EXISTS `regions`;
CREATE TABLE `regions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `parentId` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父ID，自关联',
  `regionName` varchar(120) NOT NULL DEFAULT '' COMMENT '地区名称',
  `parentPath` varchar(255) NOT NULL DEFAULT '' COMMENT '父路径',
  `firstLetter` char(1) NOT NULL DEFAULT '' COMMENT '首字母',
  `regionType` tinyint(1) NOT NULL DEFAULT '2' COMMENT '类型：1省级，2市级，3区级',
  `agencyId` smallint(5) unsigned NOT NULL DEFAULT '0',
  `shippingId` int(2) NOT NULL COMMENT '市场级别',
  `visible` tinyint(3) NOT NULL COMMENT '是否可见',
  `rowId` varchar(20) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `parent_id` (`parentId`),
  KEY `region_type` (`regionType`),
  KEY `agency_id` (`agencyId`),
  KEY `region_name` (`regionName`),
  KEY `rowId` (`rowId`)
) ENGINE=InnoDB AUTO_INCREMENT=1381038 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of regions
-- ----------------------------

-- ----------------------------
-- Table structure for sale_apply_money
-- ----------------------------
DROP TABLE IF EXISTS `sale_apply_money`;
CREATE TABLE `sale_apply_money` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL COMMENT '用户ID',
  `member_name` varchar(50) NOT NULL DEFAULT '' COMMENT '用户Name',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '0、未付款；1、已付款',
  `certificate_code` varchar(50) NOT NULL DEFAULT '' COMMENT '证件号码',
  `bank_type` varchar(50) DEFAULT NULL COMMENT '开户行',
  `bank_code` varchar(20) DEFAULT '' COMMENT '银行卡号',
  `bank_name` varchar(50) DEFAULT '' COMMENT '开户人姓名',
  `bank_add` varchar(200) DEFAULT '' COMMENT '开户行地址',
  `money` decimal(10,2) NOT NULL COMMENT '金额',
  `bake` varchar(200) DEFAULT '' COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '取款时间',
  `update_id` int(11) DEFAULT NULL COMMENT '汇款人ID',
  `update_name` varchar(50) DEFAULT '' COMMENT '汇款人姓名',
  `update_time` datetime DEFAULT NULL COMMENT '汇款时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='提款申请表';

-- ----------------------------
-- Records of sale_apply_money
-- ----------------------------

-- ----------------------------
-- Table structure for sale_member
-- ----------------------------
DROP TABLE IF EXISTS `sale_member`;
CREATE TABLE `sale_member` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL COMMENT '用户ID',
  `member_name` varchar(50) DEFAULT NULL COMMENT '用户姓名',
  `certificate_type` tinyint(4) DEFAULT NULL COMMENT '1、身份证',
  `certificate_code` varchar(50) DEFAULT '' COMMENT '证件号码',
  `bank_type` varchar(50) DEFAULT NULL COMMENT '开户行',
  `bank_code` varchar(20) DEFAULT '' COMMENT '银行卡号',
  `bank_name` varchar(50) DEFAULT '' COMMENT '开户人姓名',
  `bank_add` varchar(200) DEFAULT '' COMMENT '开户行地址',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '财务审核状态：1、刚注册；2、提交申请；3、审核通过；4、审核失败',
  `is_sale` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否为推广员：0、不是；1、是',
  `referrer_id` int(11) DEFAULT '0' COMMENT '推荐人ID，为零没有推荐人',
  `referrer_name` varchar(50) DEFAULT '' COMMENT '推荐人姓名',
  `referrer_code` varchar(20) DEFAULT NULL COMMENT '推荐人的推荐码',
  `referrer_pid` int(11) DEFAULT '0' COMMENT '推荐人的推荐人的ID，第二级推荐人为0',
  `referrer_pname` varchar(50) DEFAULT NULL COMMENT '推荐人的推荐人的姓名',
  `referrer_path` int(11) DEFAULT NULL COMMENT 'path路径，存储格式/1/2/，存储“/”为第一级分销商',
  `grade` tinyint(4) NOT NULL DEFAULT '1' COMMENT '刚进入推荐人等级：1、第一级，自己申请；2、第二级数，由一级推广；3、第三级，由二级分销而来',
  `sale_code` varchar(20) DEFAULT '' COMMENT '我的推广码，用来生成推广的URL',
  `audit` varchar(200) DEFAULT NULL COMMENT '审核意见',
  `audit_id` int(11) DEFAULT NULL COMMENT '审核人ID',
  `audit_name` varchar(50) DEFAULT NULL COMMENT '审核人姓名',
  `create_time` datetime DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='用户推广表';

-- ----------------------------
-- Records of sale_member
-- ----------------------------

-- ----------------------------
-- Table structure for sale_order
-- ----------------------------
DROP TABLE IF EXISTS `sale_order`;
CREATE TABLE `sale_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `buy_id` int(11) NOT NULL COMMENT '购买人ID',
  `buy_name` varchar(50) NOT NULL DEFAULT '' COMMENT '购买人Name',
  `member_id` int(11) NOT NULL COMMENT '拿分佣用户ID',
  `member_name` varchar(50) NOT NULL COMMENT '拿分佣用户Name',
  `product_id` int(11) NOT NULL COMMENT '商品ID',
  `product_name` varchar(255) NOT NULL DEFAULT '' COMMENT '商品名称',
  `seller_id` int(11) NOT NULL COMMENT '商家ID',
  `seller_name` varchar(200) NOT NULL DEFAULT '' COMMENT '商家名称',
  `order_id` int(11) NOT NULL COMMENT '订单ID',
  `order_sn` varchar(50) NOT NULL DEFAULT '' COMMENT '订单号',
  `orders_product_id` int(11) NOT NULL COMMENT '网单ID',
  `order_time` datetime NOT NULL COMMENT '下单日期',
  `money_all` decimal(10,2) NOT NULL COMMENT '总金额',
  `act_money` decimal(10,2) NOT NULL COMMENT '优惠金额，单品立减+订单其他优惠金额分摊之和',
  `money` decimal(10,2) NOT NULL COMMENT '单价',
  `number` int(11) NOT NULL COMMENT '购买数量',
  `sale_money` decimal(10,2) NOT NULL COMMENT '佣金金额，（总金额-优惠金额-退款金额）*佣金比例',
  `sale_scale` decimal(10,2) NOT NULL COMMENT '佣金比例，生成记录时候记录的值',
  `sale_state` tinyint(4) NOT NULL COMMENT '佣金状态：1、预计收益；2、可以提现；3、提现中；4、提现完成',
  `sale_type` tinyint(4) NOT NULL COMMENT '奖励类型：1、订单消费',
  `sale_grade` tinyint(4) NOT NULL COMMENT '分佣级数：1、第一级分销；2、第二级分销；',
  `back_number` int(11) NOT NULL COMMENT '退货数量',
  `back_money` decimal(10,2) NOT NULL COMMENT '退款金额',
  `back_ids` varchar(200) NOT NULL DEFAULT '' COMMENT '退货ID，如果发生多次退货，用逗号分隔开',
  `sale_apply_money_id` int(11) NOT NULL DEFAULT '0' COMMENT '提款的ID',
  `create_time` datetime NOT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=167 DEFAULT CHARSET=utf8 COMMENT='收入流水表';

-- ----------------------------
-- Records of sale_order
