-- ----------------------------
-- Table structure for seller_apply
-- ----------------------------
DROP TABLE IF EXISTS `seller_apply`;
CREATE TABLE `seller_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `name` varchar(50) NOT NULL COMMENT '用户名',
  `password` varchar(50) NOT NULL COMMENT '密码',
  `company` varchar(200) DEFAULT NULL COMMENT '公司名称',
  `bussiness_license` varchar(200) DEFAULT NULL COMMENT '营业执照注册号',
  `tax_license` varchar(200) DEFAULT NULL COMMENT '税务登记号',
  `company_province` varchar(50) DEFAULT NULL COMMENT '企业注册省',
  `company_city` varchar(50) DEFAULT NULL COMMENT '企业注册市',
  `company_start_time` datetime DEFAULT NULL COMMENT '营业开始日期',
  `company_end_time` datetime DEFAULT NULL COMMENT '营业结束日期',
  `company_add` varchar(200) DEFAULT NULL COMMENT '常用地址',
  `telephone` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `fax` varchar(50) DEFAULT NULL COMMENT '传真',
  `bussiness_license_image` varchar(200) DEFAULT NULL COMMENT '营业执照扫描件',
  `organization` varchar(50) DEFAULT NULL COMMENT '组织机构代码',
  `bank_user` varchar(50) DEFAULT NULL COMMENT '开户行账户名称',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '开户行',
  `bank_name_branch` varchar(200) DEFAULT NULL COMMENT '开户行支行名称',
  `brand_name_code` varchar(50) DEFAULT NULL COMMENT '开户行支行联行号',
  `bank_code` varchar(100) DEFAULT NULL COMMENT '银行账号',
  `bank_province` varchar(50) DEFAULT NULL COMMENT '开户行省',
  `bank_city` varchar(50) DEFAULT NULL COMMENT '开户行市',
  `legal_person` varchar(50) DEFAULT NULL COMMENT '法定代表人',
  `legal_person_card` varchar(20) DEFAULT NULL COMMENT '法定代表人身份证',
  `person_card_up` varchar(200) DEFAULT NULL COMMENT '身份证正面扫描件',
  `person_card_down` varchar(200) DEFAULT NULL COMMENT '身份证背面扫描件',
  `person_phone` varchar(50) DEFAULT NULL COMMENT '手机',
  `email` varchar(255) DEFAULT NULL COMMENT 'email',
  `state` tinyint(4) NOT NULL COMMENT '1、提交申请；2、审核通过；3、缴纳保证金；4、审核失败',
  `type` tinyint(4) NOT NULL COMMENT '1、平台自营；2、商家入驻',
  `opt_id` int(11) DEFAULT NULL COMMENT '审核人ID',
  `bond` int(11) DEFAULT NULL COMMENT '保证金额度',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `invoice_flag` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8 COMMENT='商家申请表';

