  `state` int(1) DEFAULT '1' COMMENT '状态 1-使用中 2-禁用',
  `seller_id` int(11) DEFAULT NULL COMMENT '商家id',
  `trans_name` varchar(255) DEFAULT '' COMMENT '模板名称',
  `trans_type` int(11) DEFAULT '0' COMMENT '计价方式 1-按件数 2-按重量',
  `trans_ratio` int(11) DEFAULT '0' COMMENT '换算比例，用于体积与重量的换算',
  `trans_express` int(1) DEFAULT NULL COMMENT '快递',
  `trans_express_info` longtext COMMENT '快递模板信息',
  `trans_ems` int(1) DEFAULT NULL COMMENT 'EMS',
  `trans_ems_info` longtext COMMENT 'EMS模板信息',
  `trans_mail` int(1) DEFAULT NULL COMMENT '平邮',
  `trans_mail_info` longtext COMMENT '平邮模板信息',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `trans_time` int(11) DEFAULT '0' COMMENT '发货时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='卖家运费模板';

-- ----------------------------
-- Records of seller_transport
-- ----------------------------

