  `create_id` int(11) NOT NULL COMMENT '修改人',
  `create_name` varchar(50) NOT NULL COMMENT '修改人账号',
  `content` varchar(255) NOT NULL COMMENT '修改内容',
  `create_time` datetime NOT NULL COMMENT '修改时间',
  `product_cate_id` int(11) NOT NULL COMMENT '商品分类id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='商家类型修改日志表';

