  `scope` tinyint(3) DEFAULT NULL COMMENT '应用范围: 1-商家 2-平台',
  `res_id` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '资源id,有些菜单及按钮需要特定id以注册点击事件',
