INSERT INTO `pc_seller_index` VALUES ('1', '1', '/images/ad/e917f79f-4f30-4466-adf2-694948754129.jpg', '北京易写科技有限公司旗下B2B2C、B2C、B2B、O2O拥有自主的知识产权。公司定位中高端电子商务提供商、最适合二次开发的电子商务系统。 核心成员均来自一线互联网电商公司，有京东、海尔电商、苏宁易购等工作经历，对互联网、电子商务有深刻理解，有着丰富的电商运营经验，具有大型电商平台架构和技术开发经验。 这是易写科技不同于其他电商软件提供商，更是易写科技核心竞争力！', '<p class=\"pa_t1\" style=\"padding: 8px 0px 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\">北京易写科技有限公司是国内最专注的电商服务的软件公司，公司位于北京市，是一家拥有自主知识产权的高新科技公司，并相聚获得中关村高新、国家高新认证。</p><p class=\"pa_t1\" style=\"padding: 8px 0px 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\">北京易写科技有限公司旗下B2B2C、B2C、B2B、O2O拥有自主的知识产权。公司定位中高端电子商务提供商、最适合二次开发的电子商务系统。 核心成员均来自一线互联网电商公司，有京东、海尔电商、苏宁易购等工作经历，对互联网、电子商务有深刻理解，有着丰富的电商运营经验，具有大型电商平台架构和技术开发经验。 这是易写科技不同于其他电商软件提供商，更是易写科技核心竞争力！</p><p class=\"pa_t1\" style=\"padding: 8px 0px 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\">易写科技旗下B2B2C电商平台、B2C电商系统、B2B电商系统、O2O电商系统，拥有自主的知识产权， 采用Java作为开发语言，结合团队在京东、海尔电商的实际开发经验，不断开发完善， 产品从丰富产品功能、提升用户体验、优化系统性能等方法入手，经过多次升级改版，多次为大型集团公司定制开发，受到国内外业界一直好评。</p><p class=\"pa_t1\" style=\"padding: 8px 0px 0px; margin-top: 0px; margin-bottom: 0px; text-indent: 2em; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\">我们的客户有中国人寿（人寿I购）、中信集团（中信e家）、桔子分期（年轻人分期购物平台）、北方大陆产业集团（北方惠购）、中能国际（跨境优通）、吉龙商城（跨境电商平台）、蜜麻花（母婴电商平台）、武汉艺术品交易中心（汉艺网）等，优质的服务得到客户一致的好评，其中和一些客户和我们建立了长期的战略合作关系。</p>', '1', 'yixiekeji', '2017-12