INSERT INTO `system_notice` VALUES ('2', '商城系统之营销活动整点抢购', '商城系统把细节做到极致，此篇文章主要讲述的是营销活动整点抢购。', '<p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'>&nbsp;<span style=\'font-family: 宋体;\'>国内做电商基本上是活动驱动型的，无论天猫、京东、苏宁易购、一号店等综合电商平台，还是贝贝、蜜芽、海尔商城、网易考拉海购等垂直电商，什么时候打开都有活动在进行，所以营销系统对于商城是非常重要的！此篇文章主要讲述的是</span>ejavashop java<span style=\'font-family: 宋体;\'>商城整点抢购的功能。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'>&nbsp;</p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\'font-family: 宋体;\'>整点抢购这种促销模式非常常见，就是把一天分成几个不同的时间段，然后每个时间段设置不同的商品，以低价的方式供用户抢购，这种促销活动在京东、苏宁易购、国美电器、一号店等等都有，而且效果非常好。</span></p><p><br/></p>', '2018-03-22 13:50:17', '1', '2018-03-22 13:54:21', '1', '1', '1');
INSERT INTO `system_notice` VALUES ('3', 'SPU和SKU的设计', 'SPU是 Standard Product Unit，意即标准产品单元，SKU是Stock Keeping Unit缩写', '<p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>&nbsp;&nbsp;SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>、</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>都是电商平台商品管理体系中的概念，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>是</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>&nbsp;Standard Product Unit</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>，意即标准产品单元，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>是</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>Stock Keeping Unit</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>缩写，原本是商超库存计量单位。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>&nbsp;</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>&nbsp; &nbsp; &nbsp; &nbsp;对于电商而言，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>有一个唯一编码，一个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>代表一个产品；</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>为一个产品不同属性、规格之间的编码。也就是说，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>代表产品，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>代表属性与规格；一个产品，可以是单属性产品，也可以是多属性产品，也就是说一个产品可以有一个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>，也可以有多个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>&nbsp;</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>&nbsp; &nbsp; &nbsp; SPU/SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>在不同的平台，有不同的表现形式。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>&nbsp;</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>&nbsp; &nbsp; &nbsp; &nbsp;比如，在亚马逊，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>被称为父产品，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>被称为子产品。意思是不同</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>产品之间，会有父产品的共同属性，但又因为规格、属性、尺码等不同而成为单独的产品，每个子产品之间，都是一个独立的产品。</span></p><p style=\'margin-top: 16px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 26px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; vertical-align: baseline;\'><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>&nbsp; &nbsp; &nbsp; &nbsp;SPU/SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>在不同的平台，有不同的表现形式。</span></p><p style=\'margin-top: 16px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 26px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; vertical-align: baseline;\'><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>&nbsp; &nbsp; &nbsp; &nbsp;比如，在亚马逊，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>被称为父产品，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>被称为子产品。意思是不同</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>产品之间，会有父产品的共同属性，但又因为规格、属性、尺码等不同而成为单独的产品，每个子产品之间，都是一个独立的产品。</span></p><p style=\'margin-top: 16px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 26px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; vertical-align: baseline;\'><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>&nbsp; &nbsp; &nbsp; &nbsp; 京东由于采取类似于海外电商的模式，会给每个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>赋予唯一编码，并且每个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>会以</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>形成一个链接，而</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>是系统后台对不同属性、规格但又同属同一系的子产品进行统一管理的编码。京东的商品，无论是报名活动、推广，都以</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>为主，</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>参与商家日常操作的情形很少，或者说</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>无法直接参与到日常的买卖中来，只是系统管理逻辑，所有的订单操作，都是针对</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>的，直接一点说，就是只能通过</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>下单。京东的商品，一款拥有多</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>的商品，往往有多个链接，而不是像淘宝那样一款产品只有一个链接。这种设定的逻辑，就是哪个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>销售的好，在搜索里面就会展现哪个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>所对应的商品的主图。在实际运营中，必然要留意，哪个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>是买家最受欢迎的，以及是自家最希望展现的。</span></p><p style=\'margin-top: 16px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 26px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; vertical-align: baseline;\'><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>&nbsp; &nbsp; &nbsp; &nbsp; 淘宝与天猫的逻辑，与京东或者亚马逊不同，淘宝与天猫的每一款产品，都拥有一个独立的</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>，也就是小二经常说的宝贝</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>ID</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>，淘宝与天猫也有</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>概念，不过淘宝天猫的</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>，都是附着在</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SPU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>下，无论是买家还是卖家，在商品详情页面或者后台管理页面，都仅仅是一个可选择的子项，并不会单独赋予一个可操作的数字编码。淘宝系商品无论哪个</span><span style=\'font-family: Arial; color: rgb(68, 68, 68);\'>SKU</span><span style=\'font-family: 宋体; color: rgb(68, 68, 68);\'>卖得好，搜索里展现的，永远是商家上传到系统中的商品中的主图。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'>&nbsp;</p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'><span style=\'font-family: 宋体;\'>&nbsp; &nbsp; &nbsp; &nbsp; 以上是各大主流电商关于</span>SPU<span style=\'font-family: 宋体;\'>和</span>SKU<span style=\'font-family: 宋体;\'>的设计，而</span>ejavashop<span style=\'font-family: 宋体;\'>的</span>SPU<span style=\'font-family: 宋体;\'>和</span>SKU<span style=\'font-family: 宋体;\'>的设计类似淘宝和天猫，每一个商品都有独立的</span>SPU<span style=\'font-family: 宋体;\'>，规格、属性、尺码不同为</span>SKU<span style=\'font-family: 宋体;\'>，搜索的展示的图片也是和淘宝天猫一样的。</span></p><p><br/></p>', '2018-03-22 13:51:27', '1', '2018-03-22 13:51:26', null, '1', '1');
INSERT INTO `system_notice` VALUES ('4', '商城系统之权限设计', '商家的后台和平台的后台安全和权限控制是用的Apache Shiro', '<p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal;\'>ejavashop&nbsp;<span style=\'font-family: 宋体;\'>商家的后台和平台的后台安全和权限控制是用的</span>Apache Shiro<span style=\'font-family: 宋体;\'>！</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; text-indent: 32px;\'>Apache Shiro<span style=\'font-family: 宋体;\'>一个功能强大，使用简单的</span>Java<span style=\'font-family: 宋体;\'>安全框架，它为开发人员提供一个直观而全面的认证，授权，加密及会话管理的解决方案。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; text-indent: 32px;\'>Shiro<span style=\'font-family: 宋体;\'>的主要功能是管理应用程序中与安全相关的全部，同时尽可能支持多种实现方法。</span>Shiro<span style=\'font-family: 宋体;\'>是建立在完善的接口驱动设计和面向对象原则之上的，支持各种自定义行为。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; text-indent: 32px;\'>Apache shiro<span style=\'font-family: 宋体;\'>的话，简单，易用，功能强大，在国内互联网行业应用十分广泛，</span>Spring<span style=\'font-family: 宋体;\'>官网就是用的</span>Shiro<span style=\'font-family: 宋体;\'>。</span></p><p style=\'margin-top: 0px; margin-bottom: 0px; color: rgb(102, 102, 102); line-height: 24px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; text-indent: 32px;\'>ejavashop&nbsp;<span style=\'font-family: 宋体;\'>权限是基于</span>RBAC(Role-Based Access Control<span style=\'font-family: 宋体;\'>，基于角色的访问控制</span>)<span style=\'font-family: 宋体;\'>，就是用户通过角色与权限进行关联。权限控制按钮级别，其中每一个按钮都有一个或者多个</span>URL<span style=\'font-family: 宋体;\'>，即使知道</span>URL<span style=\'font-family: 宋体;\'>，在浏览器中输入</span>URL<span style=\'font-family: 宋体;\'>，没有给角色赋权限，那么也无法访问数据。</span></p><p><br/></p>', '2018-03-22 13:55:25', '1', '2018-03-22 13:55:24', null, '1', '1');
